import React, { Component } from "react";
import headshot from "../photos/ColorHeadshot.png";
import InstagramButton from "./instagrambutton";

class AboutTitle extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          display: "grid",
          justifyContent: "center",
          gridTemplateColumns: "1fr 20px",
          gridTemplateRows: "1fr 1fr",
        }}
      >
        <div
          style={{
            height: 200,
            width: "auto",
            backgroundColor: "rgb(255, 203, 105)",
            fontFamily: "Unna",
            fontSize: 70,
            fontWeight: "bold",
            display: "grid",
            alignContent: "center",
            justifyContent: "center",
          }}
        >
          <div style={{}}>
            <div style={{ alignContent: "center" }}>Vivan</div>
            <div style={{ alignContent: "center" }}>Marwaha</div>
          </div>
        </div>
        <InstagramButton style={{ gridRow: "2/3" }} />
        <img
          src={headshot}
          alt="Vivan"
          style={{
            maxWidth: "80%",
            width: "auto",
          }}
        />
      </div>
    );
  }
}

export default AboutTitle;
